import logo from './logo.svg';
import './App.css';
import Login from './components/Login.js';
import { Switch, Router } from 'react-router-dom/cjs/react-router-dom.min';

function App() {
  return (
    <Router>
      <Switch>
            <Route path="/signup" component={Signup}/>
            <Route path="/login" component={Login}/>
      </Switch>
    </Router>
  );
}

export default App;
